import React,{useState} from "react";
import './Registro.scss'
import {Link} from 'react-router-dom';
import huellita from '../../assets/images/huellita.png';

function Registro(){
    const handelSubmit=(e)=>{
            e.preventDefault();
    }
    const[email, setemail]=useState('');
    const[name, setname]=useState('');
    const[pwd1, setpwd1]=useState('');
    const[pwd2, setpwd2]=useState('');

    return(
        <div className="main-register">

            <div className="left-side">
                <div className="welcomeNote">
                    <p>¿Ya eres administrador?
                    <Link id='links-sigin' to="/Login">Login</Link>
                    </p>
                </div>
            
            <div className="left-side">
                    <div className="register-container">
                        <h1>Gracias por querer ser parte de Huellitas de Esperanza</h1>
                        <form onSubmit={handelSubmit}>
                        <div className="input-group">
                            <h5>Nombre Completo</h5>
                            <input type="text" name="Name" value={name} onChange={(e)=>{setname(e.target.value)}} id= "name"/>
                        </div>
                        <div className="input-group">
                            <h5>Correo eléctronico</h5>
                            <input type="email" name="email" value={email} onChange={(e)=>{setemail(e.target.value)}} id= "email1"/>
                        </div>
                        <div className="input-group">
                            <h5>Contraseña</h5>
                            <input type="password" name="pwd" value={pwd1} onChange={(e)=>{setpwd1(e.target.value)}} id= "pwd1"/>
                        </div>
                        <div className="input-group">
                            <h5>Confirmar contraseña</h5>
                            <input type="password" name="pwd" value={pwd2} onChange={(e)=>{setpwd2(e.target.value)}} id= "pwd2"/>
                        </div>
                            <input type="submit" id="sbtn" value="submit"></input>
                        </form>
                    </div>
            </div>
            </div>
        </div>
    )
}

export default Registro;
